// export default Header;
import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <div className="bg-indigo-800 md:p-3 flex justify-between items-center">
      <div className="text-white">
        <span className="text-2xl md:text-4xl font-extrabold tracking-wide">User Management Dashboard</span>
      </div>
      <div className="flex items-center space-x-4">
        <div className='bg-gray-800 px-10 py-5 rounded-xl'>
          <div className='flex justify-end'>
            <button className='bg-pink-600 text-white font-semibold px-4 py-4 rounded-lg mr-2 text-xl transition duration-300 hover:bg-pink-700'>
              <Link to={'/'}>User Details</Link>
            </button>
            <button className='bg-pink-600 text-white font-semibold px-4 py-2 rounded-lg text-xl transition duration-300 hover:bg-pink-700'>
              <Link to={'/createAccount'}>Account Creation</Link>
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Header;
